import React from "react";
import { Nav, Container, Button, Row, Col, Image } from "react-bootstrap";
import { LinkContainer } from "react-router-bootstrap";
import Fade from "react-reveal";
import image1 from "../image1.jpeg";
import divider from "../divider1.png";

import Navigation from "../components/Navigation";
import "../styles/index.css";

const About = () => (
  <>
    <script
      src="https://kit.fontawesome.com/a17da011a4.js"
      crossorigin="anonymous"
    ></script>
    <div className="officer-nav">
      <Navigation></Navigation>
      <div className="header-text">
        <Container>
          <Row>
            <p className="heading-about">OFFICERS</p>
            <p className="officer-date">2021-2022</p>
          </Row>
        </Container>
      </div>
    </div>
    <br />
    <div className="d-flex justify-content-center">
      <Container>
        <Fade></Fade>
        <br />
        <br />
        <br />
        <img src={divider} height="80px" width="1000px" />
        <br />
        <br />
      </Container>
    </div>
  </>
);

export default About;
